@import url("//at.alicdn.com/t/font_631781_uzwcwz6vcmcxr.css");
$nx-color: #449efe;
$nx-color2: #0470b8;
$all-padding: 0;
$nx-width: 76.25rem;

.loginbox {
	width: 60%;
	height: 60%;
	min-width: 400px;
	max-width: 500px;
	padding: 20px;
	overflow: auto;
	margin: auto;
	position: absolute;
	top: 0;
	left: 0;
	bottom: 0;
	right: 0;
}

.left {
	float: left;
	padding-left: $all-padding;
}

.right2 {
	font-size: large;
	margin-top: auto;
	float: right;
	padding-left: $all-padding;
}
.right2-r {
	position: relative;

}
.right2-button {
	margin-right: 15px;
}
.gotoUser {
	cursor: pointer;
	border-bottom: 1px solid white;
	margin-right: 10px;
	+span {
		display: inline-block;
		width: 30px;
		position: absolute;
		// right:-30px
	}
}

.right {
	margin-top: 7px;
	cursor: pointer;
	float: right;
	padding-right: $all-padding;
}

.right1 {
	cursor: pointer;
	float: right;
	padding-right: $all-padding;
}

#headTop {
	width: 100%;
	height: 3rem;
	background: rgb(51, 51, 51);
	// background: #587cf7;
	line-height: 40px;

	// padding: $all-padding;
	div {
		width: $nx-width;
		height: 100%;
		margin: 0 auto;

		ul {
			height: 100%;

			.iconfont {
				float: left;
				line-height: 2rem;
				font-size: 1.3rem;
				color: $nx-color2;
			}

			li {
				float: left;
				height: 100%;
				font-size: 14px;
				color: #c4c3c3;
				margin-top: 0.3rem;

				a {
					color: #aaa;
				}

				.lgstyle {
					color: $nx-color2;
					font-size: 28px;
					font-family: cursive;
				}
			}
		}
	}
}

#headnav {
	width: 100%;
	height: 4rem;
	// padding: $all-padding;
	background-color: #fff;
	border-bottom: 1px solid #ddd;
	overflow: hidden;

	.contains {
		width: 76.25rem;
		height: 100%;
		margin: 0 auto;

		.logo {
			width: 10rem;
			height: 1.2rem;
			margin-left: 4rem;
			margin-right: 2rem;

			img {
				margin: 5px;
				height: 50px;
			}

			span {
				float: right;
				display: inline-block;
				line-height: 80px;
				margin-left: 5px;
			}
		}

		.navlist {
			height: 100%;

			li {
				float: left;
				font-size: 20px;
				margin: 20px;
				padding: 0 6px 11px;

				&.now,
				&:hover {
					border-bottom: 2px solid $nx-color2;
				}
			}
		}
	}
}
